# =======================================
# 3.8 – Clasificación de retrasos
# =======================================

def clasificar_retraso(dias):
    if pd.isnull(dias):
        return "sin_dato"
    elif dias <= 0:
        return "a_tiempo"
    elif dias <= 3:
        return "leve"
    elif dias <= 30:
        return "moderado"
    else:
        return "extremo"

# Crear columna categórica
df_vista_base["retraso_categoria"] = df_vista_base["retraso_dias"].apply(clasificar_retraso)

# Resumen de la distribución
df_retraso_cat = df_vista_base["retraso_categoria"].value_counts(normalize=True).reset_index()
df_retraso_cat.columns = ["categoria_retraso", "proporcion"]

df_retraso_cat

