# =======================================
# 4.1.b. – Estadísticos descriptivos y detección de outliers
# =======================================
import numpy as np
import pandas as pd

variables_numericas = ["total_pago", "total_productos", "total_flete",
                       "tiempo_entrega", "tiempo_estimado", "retraso_dias"]

resumen_outliers = []

for var in variables_numericas:
    q1 = df_vista_base[var].quantile(0.25)
    q3 = df_vista_base[var].quantile(0.75)
    iqr = q3 - q1
    lim_inf = q1 - 1.5 * iqr
    lim_sup = q3 + 1.5 * iqr
    outliers = ((df_vista_base[var] < lim_inf) | (df_vista_base[var] > lim_sup)).sum()

    resumen_outliers.append({
        "variable": var,
        "mínimo": df_vista_base[var].min(),
        "Q1": q1,
        "mediana": df_vista_base[var].median(),
        "Q3": q3,
        "máximo": df_vista_base[var].max(),
        "IQR": iqr,
        "límite inferior": lim_inf,
        "límite superior": lim_sup,
        "outliers": outliers
    })

df_resumen_outliers = pd.DataFrame(resumen_outliers)
df_resumen_outliers

