import pandas as pd
import plotly.express as px
from scipy.stats import f_oneway

# --- 1. Variables dependientes ---
variables_dependientes = [
    "total_pago", "total_productos", "total_flete",
    "tiempo_entrega", "tiempo_estimado", "retraso_dias"
]

# --- 2. Calcular ANOVA individual por variable dependiente ---
resultados_anova = []

for var in variables_dependientes:
    grupos = [df_vista_base[df_vista_base["satisfaccion_binaria"] == g][var].dropna()
              for g in df_vista_base["satisfaccion_binaria"].unique()]
    f_stat, p_val = f_oneway(*grupos)
    resultados_anova.append({
        "Variable dependiente": var,
        "F-Statistic": round(f_stat, 3),
        "p-Value": round(p_val, 5),
        "Significativo (p<0.05)": "Sí" if p_val < 0.05 else "No"
    })

# --- 3. Mostrar tabla resumen ---
df_anova = pd.DataFrame(resultados_anova)
print("=== Resultados ANOVA por variable dependiente ===")
display(df_anova)

# --- 4. Transformar datos a formato largo para visualización ---
df_long = df_vista_base.melt(
    id_vars="satisfaccion_binaria",
    value_vars=variables_dependientes,
    var_name="Variable",
    value_name="Valor"
)

# --- 5. Gráfico combinado de boxplots ---
color_map = {0: "red", 1: "green"}

fig = px.box(
    df_long,
    x="Variable",
    y="Valor",
    color="satisfaccion_binaria",
    color_discrete_map=color_map,
    points="outliers",
    title="Comparación de variables numéricas por satisfacción del cliente",
    labels={
        "Variable": "Variables numéricas",
        "Valor": "Valor observado",
        "satisfaccion_binaria": "Satisfacción (0=No, 1=Sí)"
    },
    template="simple_white"
)

# --- Ajustes visuales ---
fig.update_traces(opacity=0.6)
fig.update_layout(
    height=600,
    title_font=dict(size=18, color="black", family="Arial Black"),
    xaxis_title_font=dict(size=13),
    yaxis_title_font=dict(size=13),
)
fig.show()

